$(document).ready(function(){function p(){e.each(function(e){t=$(this);t.css("position","relative");if(t.find(".ab-parent").length>0){t.find(".ab-parent").remove()}if(t.find(".ab-parent").length==0){n=t.width();t.append("<div class='ab-parent'></div>");r=t.attr("data-border-size");if(typeof r!==typeof undefined&&r!==false){}else{r=30}i=t.attr("data-border-height");if(typeof i!==typeof undefined&&i!==false){}else{i=r*1.5}s=t.attr("data-border-color");if(typeof s!==typeof undefined&&s!==false){}else{s="#E84C4C"}o=t.attr("data-border-spacing");if(typeof o!==typeof undefined&&o!==false){}else{o=10}u=parseInt(n*(120/100));a=parseInt(u/r);h=t.attr("data-border-position");if(typeof h!==typeof undefined&&h!==false){}else{h="top"}l=t.find("div.ab-parent");for(f=0;f<a;f++){l.append("<span class='ab-symbol'></span>")}c=t.find("span.ab-symbol");if(h=="top"){l.css({width:u+"px",height:"auto",top:-(r/2)+"px"});if(t.hasClass("ab-oblong")){l.css({top:-(i/2)+"px"})}}else if(h=="bottom"){l.css({width:u+"px",height:"auto",bottom:-(r/2)+"px"});if(t.hasClass("ab-oblong")){l.css({bottom:-(i/2)+"px"})}}if(t.hasClass("ab-circle")){c.addClass("ab-circle-border");c.css({width:r+"px",height:r+"px","background-color":s})}else if(t.hasClass("ab-triangle")){c.addClass("ab-triangle-border");c.css({"border-width":r/2+"px","border-color":s+" transparent","border-style":"solid"});if(h=="top"){c.css("border-top","none")}else if(h=="bottom"){c.css("border-bottom","none")}}else if(t.hasClass("ab-oblong")){c.addClass("ab-oblong-border");c.css({width:r-o+"px",height:i+"px","background-color":s,"margin-right":o+"px"})}}})}$("body").css("overflow-x","hidden");var e=$(".AwesomeBorder"),t,n,r,i,s,o,u,a,f,l,c,h;p();$(window).resize(function(){p()})})